import './Result.css';

const Result = ({onExit}) => {
  return (
    <div className="result">
      <h2>학습종료</h2>
      <p>수고하셨습니다 :）</p>
      div
      <button onClick={onExit}>처음으로 돌아가기</button>
    </div>
  );
};

export default Result;
